// components/Header.js

import React, { Component } from 'react'
import NavBar from "./NavBar";
import Button from "./Button"


const headerStyle = {
    position: "relative",
    background: "url(https://images.pexels.com/photos/598917/pexels-photo-598917.jpeg?auto=compress&cs=tinysrgb&dpr=3&w=500)",
    // width: "2309px",
    height: "700px",
    backgroundRepeat:"no-repeat",
    backgroundSize:"content",
    fontFamily: "Alegreya Sans",
    fontFtyle: "normal",
    fontWeight: "normal",
    fontSize: "30px",
    lineHeight: "36px",
    color: "#F0D8D8",
    backgroundPosition:"center",
    opacity:1
  };

const buttonStyle ={
  width:"200px",
  padding:"5px",
  background: "linear-gradient(233.06deg, #FE1903 -61.81%, #F8710F 74.41%)"

}

const buttonWatchStyle ={
  minWidth:"200px",
  padding:"5px",
  background: "transparent",
  border:"2px solid white",
  marginLeft:"5px"

}
const text= "Training";
const textWatch= "Watch Video";

   const imgStyle ={
    height:"500px"
   }
  const Header = () => (
    <div className="Header" style={headerStyle}>
         <NavBar />
         <div className="container mt-5">
            <div className="row">
              <div className="col mt-5">
                <h1 className="font-weight-bolder mt-5">Photography For the Future</h1>
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna</p>
              </div>
              <div className="col">
                  <img style={imgStyle} src={'/logo2.png'} />
                  <Button buttonStyle={buttonStyle} text={text}></Button>
                  <Button buttonStyle={buttonWatchStyle} text={textWatch}></Button>


              </div>
            </div>
         </div>

    </div>
  );
  
  export default Header;
